import React, { Suspense } from "react";
import { Route, Switch, Redirect } from "react-router-dom";
// import { useMutation } from 'react-query';
import UserLayout from "../../layout/UserLayout";

const Login = React.lazy(() =>
	import(/* webpackChunkName: "user-login" */ "./login.jsx")
);
const Register = React.lazy(() =>
	import(/* webpackChunkName: "user-register" */ "./register.jsx")
);
const ForgotPassword = React.lazy(() =>
	import(/* webpackChunkName: "user-forgot-password" */ "./forgot-password")
);
const ResetPassword = React.lazy(() =>
	import(/* webpackChunkName: "user-reset-password" */ "./reset-password")
);

const User = ({ match }) => {
	return (
		<UserLayout>
			<Suspense fallback={<div className="loading" />}>
				<Switch>
					<Redirect exact from={`${match.url}/`} to={`${match.url}/login`} />
					<Route
						path={`${match.url}/login`}
						render={(props) => <Login {...props} />}
					/>
					<Redirect to="/error" />
				</Switch>
			</Suspense>
		</UserLayout>
	);
};

export default User;
